import './Login.css'

function Login() {
  return (
    <div class="login">
        <input type="text" class="input_id" placeholder="아이디를 입력해주세요"/><br/>
        <input type="password" class="input_pwd" placeholder="비밀번호를 입력해주세요"/>
    </div>
  );
}

export default Login;
